import React from "react";
import { List, ListItem,  AvaListItemAvatar, ListItemText } from "@material-ui/core";

function Todo(props) {
  return (
    <List>
      <ListItem>
        <ListItemAvatar></ListItemAvatar>
        <ListItemText primary="Todo" secondary={props.text}>
          <li>{props.text}</li>
        </ListItemText>
      </ListItem>
    </List>
  );
}

export default Todo;
